import "antd/dist/antd.css";
import { Layout, Divider, Table } from "antd";
import React from "react";
import "./accesslog.css";
import Sidebar from "../../components/sidebar/Sidebar";
const { Content } = Layout;

const columns = [
  {
    title: "Browser",
    dataIndex: "browser",
  },
  {
    title: "IP",
    dataIndex: "ip",
  },
  {
    title: "Time",
    dataIndex: "time",
  },
];

const data = [];
for (let i = 0; i < 20; i++) {
    const roles = i%2 ? 'Admin' : 'Super Admin'
    data.push({
        key: i,
        name: `Edward King ${i}`,
        created_date: `24/06/22 ${i}`,
        Status: 32,
        role: roles,
    });
}

const Accesslog = () => {
  return (
    <div>
      <Divider />
      <Table columns={columns} dataSource={data} />
    </div>
  );
};

export default Accesslog;
